INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3000, 2, "vo_minigame_1013_icon_2_003_001", "クスクス、悪くない\n流れですわね", 2, 2, "ほらほら、\nまだいけるだろ？", 5000, "vo_minigame_1013_icon_1_003_001");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 3, "vo_minigame_1013_icon_2_004_001", "すばらしい\n記録ですわ", 2, 2, "へへっ、おまえら\nやるじゃねえか！", 10000, "vo_minigame_1013_icon_1_004_001");
